import React from 'react';
import {Nav,NavLink} from 'react-bootstrap';

function NavBars() {
    return (
			<div>
				<Nav>
					<NavLink to='/'>
						<h1>logo</h1>
					</NavLink>
					<NavLink to='/about'>About</NavLink>
					<NavLink to='/daily-picture'>Daily picture</NavLink>
					<Link to='/categories'></Link>
				</Nav>
			</div>
		);
}

export default NavBars;
